CREATE TABLE `gambling_histories` (
  `gamb_ID` bigint NOT NULL COMMENT 'รหัสประจำตัวประวัติการพนัน (Primary Key)',
  `user_id` int DEFAULT NULL COMMENT 'รหัสผู้ใช้ (Foreign Key จาก members)',
