  `groupLive_ID` bigint DEFAULT NULL COMMENT 'รหัสกลุ่มไลฟ์ (Foreign Key จาก group_lives)',
  `msID` bigint DEFAULT NULL COMMENT 'รหัสเกม (Foreign Key จาก gamemasters)',
  `groupId` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'รหัสกลุ่ม (Foreign Key จาก groups)',
  `grId` bigint DEFAULT NULL COMMENT 'รหัสกติกาการเดิมพัน (Foreign Key จาก gamerules)',
  `glco_quantity` decimal(30,2) DEFAULT NULL COMMENT 'จำนวนเงินที่ลงเดิมพัน',
  `glco_lose` tinyint(1) DEFAULT '0' COMMENT 'สถานะแพ้ (0 = ไม่แพ้, 1 = แพ้)',
  `glco_win` tinyint(1) DEFAULT '0' COMMENT 'สถานะชนะ (0 = ไม่ชนะ, 1 = ชนะ)',
  `glco_multiply` decimal(10,2) DEFAULT NULL COMMENT 'อัตราต่อรอง (เช่น 1:1, 1:20)',
  `glco_refund` decimal(65,2) DEFAULT NULL COMMENT 'จำนวนเงินที่คืนเมื่อชนะ',
  `datetime` timestamp NULL DEFAULT NULL COMMENT 'วันเวลาของรายการ',
  `created_at` timestamp NULL DEFAULT NULL COMMENT 'วันเวลาที่สร้างข้อมูล',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT 'วันเวลาที่อัพเดทข้อมูลล่าสุด',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT 'วันเวลาที่ลบข้อมูล (Soft Delete)',
  `glco_delete` tinyint(1) DEFAULT '0' COMMENT 'สถานะการลบ (0 = ใช้งาน, 1 = ลบ)',
  `glco_cancel` tinyint(1) DEFAULT '0' COMMENT 'สถานะการยกเลิก (0 = ไม่ยกเลิก, 1 = ยกเลิก)',
  `timestamp` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'ค่า timestamp เฉพาะของรายการ',
  `gamb_text` text COLLATE utf8mb4_general_ci COMMENT 'รายละเอียดเพิ่มเติมของรายการ',
  `isRedelivery` varchar(100) COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT 'สถานะการส่งซ้ำ (0 = ไม่ส่งซ้ำ, อื่นๆ = ส่งซ้ำ)',
  `glco_success` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'สถานะสำเร็จ (0 = ไม่สำเร็จ, 1 = สำเร็จ)'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

